(232, '', '', '', NULL, 'briteliltwinklet@prolynx.com', 0, NULL, NULL, NULL, NULL, 0, NULL, 1, 'Rachel', 'Amman', 'Rachel Amman', 'Amman, Rachel', '13451 Birch Way', 'Thornton', 'CO', '80241', '(303) 252-0594', '', 5, 279, '0000-00-00', NULL, NULL, NULL, NULL, 'None', NULL, 'rachel-amman', 0, '2013-03-10 20:29:57', 1, '2014-02-09 18:03:43', 431),
(233, '', '', '8ad8f4d4f38cec638214304d00e592918af17bd5', NULL, 'o2baflyndog@gmail.com', 0, NULL, NULL, NULL, NULL, 0, 1381637432, 1, 'Christi', 'Campbell', 'Christi Campbell', 'Campbell, Christi', '30455 Conifer Road', 'Evergreen', 'CO', '80439', '(303) 569-6278', '(303) 725-6491', 6, 149, '2013-03-28', '233_IMG_0202.jpg', 'fly high & land softly', '<p>Christi started playing frisbee competitively with her dogs in Dallas, TX in 1992.&nbsp; She began her career competing with multi-time world champions, so her bar was set pretty high from the beginning.&nbsp; She moved to Colorado in 1997, and in 1998 won her first of 6 consecutive Colorado State Championships with Red Rocket Rider.&nbsp; She also placed 3rd in the state with Wally in 1998, and 2nd in 1999.&nbsp; In 2002, Christi and Rider won the Purina Incredible Dog Challenge Winter Games, and they went on to win the PIDC National Championship at Purina Farms later that year.&nbsp; In August of 2002, they won both days of the Colorado Canine Challenge, taking 1st place in the UFO Major on Saturday and the Quadruped Women''s Open Division on Sunday, and the next day, Rider''s picture appeared on the front page of the Rocky Mountain News.&nbsp; In 2003, Christi started traveling internationally to compete, perform and teach disc dog seminars, and she and Rider won the UFO European Freestyle Championship that year.&nbsp; Christi and Rider have appeared on ESPN, ESPN2, USA Network, and several other national networks, as well as numerous local TV channels.&nbsp; She and her dogs have performed at NFL Halftimes, as well as Major League Baseball, National Soccer League, Major League Lacrosse, National Lacrosse League, Arena Football League, College Football and College Basketball games.&nbsp; In 2005, Christi and Rider won their fourth Quadruped Championship, becoming the first team ever to win the coveted Quad-Quad.&nbsp; She and Rider finished in the top 3 in the UFO World Cup Championship four times.&nbsp;</p>\n<p>Rider retired from high-level competition in 2005, and enjoyed a few more years of performing at demos and local competitions.&nbsp; For the next several years, Christi focused on judging local, national, international and world championship events.</p>\n<p>In 2010, Star Spangled Banner was born, and Christi began to think about competing again.&nbsp; In 2012, Banner was finally old enough for competition, and she and Christi started their frisbee adventure together.&nbsp; Banner qualified for the final rounds in both the Skyhoundz Regional Qualifier (her first competition) and the AWI Qualifier (her second competition), and just a few weeks into her competitive career she competed in the Purina Incredible Dog Challenge Regional in Denver.&nbsp; In her first year of competition, Banner was on national TV, qualified for 3 separate World Finals events (UFO, AWI, D-Tour), placed 3rd at the UFO D-Tour World Championship, and placed 4th in the Colorado State Championship cup race.&nbsp; Christi and Banner are eager to see what 2013 brings.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', 1, 'Public', NULL, 'christi-campbell', 0, '2013-03-10 20:29:57', 1, '2014-02-09 18:03:44', 431),
