(7, 17, 300, 'Aires', '2002-01-01', 'McNab/ Kelpie', 'Female', 1, 'Help for Homeless pets', 'We rescued Aires as an adult dog. Our other dog Bella, discovered her huddled and disheartened against the Petsmart wall. She was a bag of bones trying to disappear into that wall. For whatever reason, Bella raised her ears toward her and Aires raised her ears back, thats when we noticed another Bat Dog. And after some discussion, we adopted her. Sadly she was severely malnourished she came to us under 25lbs, her playing weight is 45lbs, and having never been let out she do not know how to run, she hopped like a deer. Like many abused dogs, she had both mental and physical issues that were almost too much for us but thankfully, we stuck it out and she has turned into an amazing frisbee dog. However, the abusive experience has haunted her for many years so if you try to say "hello" and she slinks away, don''t take it personally.\nAs for her acomplishments, Aires is a combination 5 time world qualifier in both Skyhoundz and UFO All Stars. She only played in one UfO All Star because of a career ending injury. She''s never won at that level but we blame the humans that choke at the line for that. She''s won local toss and catch, a few majors and gained some Hardware in the Quadraped. But her greatest accomplishment is rising above her past and playing her best at all times and being a great companion.', 1, '7_IMG_0477.jpg', 0, '2013-03-10 20:54:02', 1, '2013-06-09 01:13:02', 300, 0),
(8, 18, 300, 'Bella', '2000-12-04', 'BC/Heeler Mix', 'Female', 0, '', 'RIP, Bella Bella died Dec 19, 2012. Bella came from the Walton Ranch in Jackson, Wy after I had seen a free puppy flyer. She was the pick of the litter, I say this because well, I choose her and she was the 1st to go. I had never owned a herding dog let alone a high drive puppy from working parents and I had NO idea what I had gotten myself into. Bella''s 1st job was rearranging my house and making a small hole in the carpet much, much bigger. As it turned out, my husband found the perfect job for her thru smoking. Reuben, my then would be husband, smoked outside because smoking isn''t allowed in my house. So rain or shine, -25 or white out blizzard Reuben was outside smoking. Bella often joined him bringing a toy with her. Just to keep warm he would toss it and Bella got to be pretty good. Good enough that we found frisbee competitions on the internet. We did a few locals, then branched out and were sold onto the sport. Bella brought us here, to Colorado and the CDD. At first we thought these CDD people are a little weird and really into their dogs. I am now proud to say, we a little weird and really into our dogs too. Bella''s career winnings is neither long nor distinguished although she did win one Skyhoundz Western Open division freestyle and D/A in the Masters division. However to me, she was the best frisbee dog because she taught me how to be part of a team, the importance of learning how to throw and most of all, she humbled me with her sacrifices. She brought me to the world of Disc Dog and I am a better human, dog owner and trainer because she came into my life. I will be forever grateful to my Bella Bella. ', 1, '8_179911_10151063937550871_1415889995_n.jpg', 0, '2013-03-10 20:54:02', 1, '2013-06-09 01:06:48', 300, 0),
(9, 19, 245, 'Kayleigh', '1998-03-06', 'Yellow lab', 'Female', 0, '', 'Old and retired, Kayleigh loved to play frisbee back in the day. She placed in the quadruped numerous times and in the FDDO. Known for her freestyle technique of rejecting about 40% of my throws, Kayleigh taught me the true meaning of going out and having fun playing with your dog. This girl is 15 and spends her days sleeping and occasionally chasing a ball at the park!', 1, '9_IMG_0490.JPG', 0, '2013-03-10 20:54:02', 1, '2013-04-08 18:27:03', 245, 0),
(10, 20, 245, 'Lucy', '2003-10-05', 'Black lab', 'Female', 0, '', 'Retired now, Lucy was also a freestyle dog and a great toss and catch lab. She placed a few times in the Quadruped with both Peter and I! Loveable girl, she enjoys eating and belly scratches these days!', 1, '10_IMG_0115.JPG', 0, '2013-03-10 20:54:02', 1, '2013-04-08 18:23:46', 245, 0),
(11, 21, 245, 'Pisco', '2004-01-18', 'BC/lab', 'Male', 1, 'Rocky Mountain Border Collie Rescue', 'Making only a few appearances before deciding that he enjoyed running and barking rather than actually catching the frisbee, Pisco did however, earn me a first place in the Women''s division of the Quadruped. We still love our BC/lab mix!', 1, '11_IMG_0057.JPG', 0, '2013-03-10 20:54:02', 1, '2013-04-08 18:22:17', 245, 0),
