(66, 78, 234, 'Banzai', '2003-08-22', 'Mix', 'Female', 1, 'Rocky Mountain Border Collie Rescue', 'Banzai is a fireball with fur, a physical manifestation of drive, craziness and fun. Banzai came to live with Chris in 2004. She had been placed in rescue as she was too energetic and lively for her original owners. Of course, she was really looking for a job catching frisbees! Chris and Banzai found an instant connection, and success on the frisbee field has come year after year. Banzai has twice been the State Freestyle Champion, has won the Quadruped, and traveled the world to play frisbee. \nBanzai has competed in the World Championships 7 times, taking 3rd in 2007. \nShe is not discriminating, and has won events with her friends Christi Campbell, Marcel Buff, and Tina Weiss as well. Banzai was a featured performer at 6 Flags Elitch''s Theme park for the summer of 2008, and performed in hundreds of shows all over Colorado and the USA. Banzai''s passport includes Korea, Canada, Switzerland, Germany, Austria, Liechtenstein and the Netherlands. Who knows where Banzai will fly to next?\n', 1, '66_Banzai-CCC-2012.jpg', 0, '2013-03-10 20:54:03', 1, '2013-08-21 01:26:02', 234, 0),
(67, 79, 234, 'Laika', '1995-09-07', 'Border Collie', 'Female', 0, '', 'Laika was Chris''s original disc dog. Together, they learned how to play the game, and on the way managed to accumulate quite a lot of recognition for their accomplishments. In 2000,  Laika became the first dog from Colorado to qualify for the World Championships. That year, they also became the first team from Colorado to win a National Championship, when they won the Quadruped Long Distance series. Their winning ways spanned many years, with appearances on television, national and world records set, and travel all over the USA, and even trips to perform in Europe!\r\nSadly, Laika left us in 2009, just after turning 14 years old. She left behind a legacy of wonder, excitement and inspiration. She was immortalized as the logo dog in the Colorado Disc Dogs logo. \r\nHere is a great video of Laika:\r\n<iframe width="420" height="315" src="http://www.youtube.com/embed/0DRyAFJ0ROM" frameborder="0" allowfullscreen></iframe>', 1, '67_LaikaSLC.jpg', 0, '2013-03-10 20:54:03', 1, '2013-05-02 18:38:24', 234, 0),
(68, 80, 234, 'Wally', NULL, '', 'Male', NULL, NULL, NULL, 0, '', 0, '2013-03-10 20:54:03', 1, '2013-03-10 20:54:03', 1, 0),
(69, 81, 233, 'Banzai', '2003-08-26', 'Border Collie', 'Female', 1, 'Rocky Mountain Border Collie Rescue', '<p>Banzai is an amazing superstar frisbee dog!&nbsp; I have been fortunate to know her and privileged to play with her.  She came to us as a crazy 14 month old rescue dog, and has really been a joy to live with and watch her wow the frisbee world.  See Chris Sexton''s bio for more info on her.</p>', 1, '69_banzai2.jpg', 0, '2013-03-10 20:54:03', 1, '2013-04-01 23:56:33', 233, 0),
(70, 82, 233, 'Bonnie', NULL, '', 'Male', NULL, NULL, NULL, 0, '', 0, '2013-03-10 20:54:03', 1, '2013-03-10 20:54:03', 1, 0),
(71, 83, 233, 'Maggie', NULL, '', 'Male', NULL, NULL, NULL, 0, '', 0, '2013-03-10 20:54:03', 1, '2013-03-10 20:54:03', 1, 0),
