(73, 85, 233, 'Rider', '1996-01-01', 'Aussie', 'Male', 1, 'South Texas Aussie Rescue (STAR)', '<p><span style="text-decoration: underline;"><strong>Rider</strong></span> [Red Rocket Rider, 1996-2010] <span>We met in 1996, he was 11 months old. I felt like I knew him before we ever met. He was a little red dog with big ears and a big bark, slightly cow-hocked and the most beautiful flying trot I have ever seen, before or since. He was my foster dog for all of 3 minutes. We were destined to be together.<br /><br />The first time I threw a frisbee for him, he stood at my side and watched it fall, then looked at me with a quizzical "why did you throw that?" look. The second time I threw a frisbee for him, he ran out 25 yards and flew through the air with that incredible hang time that was his trademark... like michael jordan with fur... just hanging in the air like a bird, before grabbing that disc and landing lightly on his feet. I had chills just watching that first catch, and that feeling of awe and amazement never dimmed as we played frisbee together all over the world for the next decade.<br /><br />I don''t know why we get the dogs we do. I just know how incredibly blessed I was to have him in my life, and how much I will miss him for the rest of my days. I don''t have words for the joy he brought me or the things he taught me.<br /></span></p>\n<p>Some of Rider''s accomplishments include:</p>\n<p>Colorado State Champion 1998-2003</p>\n<p>Four-time Quadruped Champion (the first dog to win a QUAD-QUAD)</p>\n<p>European UFO Freestyle Champion 2003</p>\n<p>Purina Incredible Dog Challenge Freestyle Flying Disc National Champion 2002</p>\n\n<iframe width="420" height="315" src="http://www.youtube.com/embed/XaoQTudbWl8" frameborder="0" allowfullscreen></iframe>', 1, '73_merrygoroo.jpg', 0, '2013-03-10 20:54:03', 1, '2013-05-02 23:57:11', 233, 0),
