(109, 123, 283, 'Jazz', '2001-12-13', 'Border Collie', 'Female', 0, '', 'Jazz was my first Border Cillie & first disc dog, we started playing in 2005. She is 11 years old now and retired from dog sports however she still loves to play but arthritus makes her pay. She does get to enter any Masters classes though which makes her so happy. \n\n', 1, '109_Jammin_Jazz.jpg', 0, '2013-03-10 20:54:04', 1, '2013-04-03 14:04:46', 283, 0),
(110, 124, 283, 'Lexi aka "Pinkie"', '2006-02-07', 'Border Collie', 'Female', 0, '', 'Lexi, came from a long line of herding dogs from a ranch in Ft. Lupton. She started catching frisbees @ 3 months old. We started competing together in 2007. We have an amazing bond and have learned so much from each other. Our  goal each year is to finish in the top ten of the Colorado State cup which we have been able to accomplish so far. Lexi qualified for Skyhoundz World competition in 2008 and competed in Atlanta, GA. We have been fortunate enough to compete in other states and look forward to some in 2013 also. She is my special little BC that gives me 110% and has truely taught me the meaning of patience and understanding. \n\n', 1, '110_Lexi_profile.jpg', 0, '2013-03-10 20:54:04', 1, '2013-04-03 14:04:12', 283, 0),
