(304, 325, 431, 'Mariah', '2004-01-01', 'Aussie/Border Mix', 'Female', 1, 'Denver Dumb Friends League', 'Mariah is my first dog as an adult as well as my first disc dog. We caught the bug and within our first 2 years had travelled to several major competitions. Mariah had qualified for UFO, Skyhoundz and AWI world championship competitions. Image, a dog found at a shelter could have so much impact on one human soul!', 1, '304_mariah_12.jpg', 0, '2013-03-10 20:54:07', 1, '2013-04-01 01:06:20', 431, 0),
(305, 326, 431, 'The Zoe Monster', '2005-01-01', 'ACD', 'Female', 1, 'Previous Owner', '<p>Zoe is my second dog. I adopted her from her previous owner. They complained that she just kept herding the neighborhood kids! I also want that ''perfect'' disc dog. Boy, did she teach me a lot! She was so focused from day on (at 6 months old) that I always found myself trying to get her to slow down.</p>\n<p>Early on, Zoe has some issues with a Torn ACL in her knee. She had the needed surgery and has since recovered well. She has qualified for Skyhoundz, UFO and AWI world finals and placed as high as 3rd in state cup standings. She earned her nickname ''The Zoe Monster'' by always following a disc throw to the end, the very bitter end!</p>', 1, '305_zoe_21.jpg', 0, '2013-03-10 20:54:07', 1, '2013-05-05 16:26:35', 431, 0),
