(518, 563, 334, 'Marley', '2008-01-01', 'BC Mix', 'Male', 1, 'Second Chance Rescue', 'Marley is our first frisbee dog and he quite literally changed our lives. With out him we would have never been part of such a wonderful club and sport. He has helped us to go places, do things, and meet people that most never will. \n\nWhile it has not been confirmed, it is rumored that at least one of his parents escaped from a government facility where dogs where secretly being breed as part program to track and capture extra-terrestrial flying saucers. Thus explaining his unyielding need to chase flying plastic discs.\n\nMarley takes his job of frisbee very seriously. He is a blue collar dog through and through. He has taught me the true meaning of patience and always keeps me centered.', 1, '518_DSC_8703.JPG', 0, '2013-03-10 20:54:08', 1, '2013-04-01 01:20:02', 334, 0),
