(559, 604, 336, 'Shadow', '2006-12-29', 'Australian Shepard', 'Male', 0, '', 'Shadow was what Pam and I call rescued from a pet store in Thornton, CO.  The owner did not have any information other than then Shadow and his liter mates were dropped off by some trucker.  Pam and Shadow were inseprable from the moment she saw him and Shadow was bonded as soon as Pam picked him up.  Shadow started us down this enjoyable sport of Dogs and Discs one day at the dog park with my wife.  Shadow picked up a Frisbee and we got hooked very quickly.  Shadow''s accomplishments include a Gold medal at 2011 Colorado Canine Challenge in his second year in the Intermediate division T&C and several medals (two silver and one bronze) in the Advanced division T&C.  Shadow also qualified for UFO World Finals in distance in 2012 held in Florida.  What a wonderful experience!  Shadow and I also have participated with the CDD Demo team showing off his T&C skills.', 1, '559_DSC_8262.JPG', 0, '2013-03-10 20:54:08', 1, '2013-04-05 21:16:58', 336, 0),
