(692, 744, 333, 'Marley', '2008-01-01', 'BC/Bosser mix', 'Male', 1, 'Second Chance Rescue', 'Introducing Marley. We rescued him at 8wks old from an adoption fair at Wag-N-Wash. It''s quite a funny story of how we came to have Marley in our lives. We were out shopping for office furniture and there was a Wag -N-Wash next door that had puppies for adoption. So we decided to take a look and just fell in love with him. With this being our 1st dog as adults, we only sort of had an idea of what we were getting into. We new we had to find him a job to do. That''s when we discovered the CDD. Marley''s accomplishments are "Rookie of the Year Award" two years in row. In 2009 he won with Brian and in 2010 he won with me, Making him only the second dog in club history to accomplish that. He has made it possible for us to meet some wonderful, crazy disc dog people and have exposed us to a whole new world. I am sooo great full that he picked us to be his companion. Marley has taught me many things over the years, but most all he has taught me to live in the moment. That lesson alone has been the best motto to live by. Marley is a workaholic at catching flyin'' discs and a piggy when it comes to treats. Hope you will all get a chance to come and see this wonderfully, obsessed dog perform at shows and competitions.', 1, '692_IMG_1231.2_.jpg', 0, '2013-03-10 20:54:11', 1, '2013-04-03 22:27:45', 333, 0),
