(712, 767, 283, 'Ares', '2009-02-13', 'Belgian Malinois', 'Female', 1, 'Nikinos Second Chance', 'Ares is our so called "Brown sheep of the family". She is a Belgian Malinois, we adopted her at 6 months of age after being returned by several families due to her (as they called it) aggressiveness. She is very devoted and protective. We hope to have her on the field this season but she is still in the training process.', 1, '712_image.jpg', 0, '2013-03-10 20:54:11', 1, '2013-06-04 16:49:51', 283, 0),
(713, 768, 335, 'Shadow', '2006-12-29', 'Aussie', 'Male', 0, '', 'Yes, my name is Shadow and I love my family. So here is the  basic stuff  I was a "throw-away" dog.  I hated my life until I met Mom. I was always afraid and I still have flashbacks, I hate trucks, and garbage bags, and I am generally pretty shy around people. I am not sure of where I came from, but I know it was a puppy-mill were some idiot decided my siblings and I were accidents. This moron thought we were Poodle-Aussies mixes-NOT I am 100% Aussie! Anyway, we were handed off at a pet-store where the owner was told to sell them or kill them. I was discounted, and cost a hundred bucks.  Mom is my favorite person at home,  I guard her with my life. Although she is a bit weird, she thinks the universe brought us together. She believes this because she found me in the same place as her Aussie Patches who had who had passed away over ten years ago.  However, Patches was in a box outside the store, before it was a pet store in 1990.  Since her passing Mom did not have the heart to love another Aussie, but of course I stole her heart. So now it is a happier life for both of us. I have always been highly intelligent,it only took mere weeks before I aced my obedience training with Tami at American Dog School ( I am her favorite no matter what Amadeus thinks)  But lets get serious and talk about Frisbees. My mom she thinks Frisbee is about dancing around the field and throwing my Frisbees randomly about the field. I love her, so I indulge her. But lets set the record straight, I believe that Frisbees were meant to be thrown very long distances, and it is my job to chase it down and bring it back. I am certain of this today as I was the first time I had a Frisbee in my mouth. That is Dads job and we are a symbiotic team. I know his moves, and listen to him very carefully every time we are on the line. I love it! So if you want hang out and "play" go hang with my brother-but if your a true competitor beware because I am stealth, you will not see me coming and you can eat my dust as I go by! ', 1, '713_Nice_Cut_Back.jpg', 0, '2013-03-10 20:54:11', 1, '2013-04-15 10:52:13', 335, 0),
