(733, 790, 233, 'Dharma', '2006-09-22', 'Baussie', 'Female', 1, 'Aussie Rescue', '<p>Dharma came to live with me at the age of 6 months, and we were her 6th home at least, possibly more.&nbsp; I never could figure out why she had been rehomed so many times, as she is the sweetest, most wonderful girl and has been from the moment we met.&nbsp; She isn''t particularly driven to play frisbee (but she will catch one to humor me), she likes agility better, but her favorite thing on earth is to chase squirrels and elk and deer.&nbsp; If someone makes that into a competitive sport, she will be a world champ!&nbsp;</p>', 1, '733_dharmafrisbeedog.jpg', 0, '2013-03-10 20:54:12', 1, '2013-03-31 23:54:31', 233, 0),
