(809, 870, 336, 'Amadeus', '2010-01-12', 'Australian Shepard', 'Male', 0, '', 'Amadeus is his name and this Aussie loves to run.  Still young and learning the skill to catch the discs.  However in 2012 in Florida at the last UFO major he qualified for the UFO World Finals Distance event (Amadeus'' first medal).  In the UFO finals he did not strike out and even beat his brother Shadow placing 6th overall.  Amadeus loves to jump when doing freestyle.  In T&C he is fast, fast, and fast.  Quadraped may be his calling in 2013!   More to the Amadeus story to be written.  Not bad for a big Aussie at a young age.', 1, '809_Amadeus_1_CCC.JPG', 0, '2013-03-10 20:54:12', 1, '2013-04-03 14:21:52', 336, 0),
(810, 871, 335, 'Amadeus', '2010-01-12', 'Aussie', 'Male', 0, '', 'Hello, \n\nDamn I look good in the air!  Yes that''s me the Amazing Amadeus! I love you, even if I haven''t met you. I love being outside, and I love to JUMP! I am special because I was smart enough to pick Bob as my person. I knew he was the right guy, so when he picked me up at 3 weeks old, I bite him in the ear so he would remember me and not pick any of my siblings. I was born here in Frank Town Colorado. I am the son of Mozart and Opal of Cathy Davins line of Amazing Aussies. I did my obedience training with the amazing Tami Carrasco at American Dog School so I am the DOG! I have a secret to tell you, I am just starting to focus on my game. But lets keep that between us, the other dogs don''t know. Most of them think I have been playing for years, but in reality I have just been hanging out since I was 8 weeks old, so I have them all fooled. In fact I just turned three in January. But I already have an UFO world cup rank, because of taking third in the last chance competition in Nov of 2012. I was so awesome I beat my big brother Shadow (tee-hee). My Dad is my favorite person in the whole world, but when it comes to Frisbee I play free-style with my mom, she lets me fly. However, I will run like the wind for Dad and those Quad dogs better stay out of my way, because I am a force to be reckoned with and I just keep getting better and butterflies aren''t as cool as Frisbees anymore. I will make you laugh, and I am a jokester, but don''t take me as a fool, for I am the Amazing Amadeus I will see you on the field.  ', 1, '810_Amadeus_2_CCC.JPG', 0, '2013-03-10 20:54:12', 1, '2013-04-14 18:33:48', 335, 0),
(811, 872, 334, 'Keva', '2010-02-23', 'BC Mix', 'Female', 1, 'Western Border Collie Rescue', 'Keva, aka Special "K", is our clown. As a rescue she had a bit of a bumpy start and was extremely shy and didn''t trust much. After we earned her trust, her true colors really started to shine and it turns out this girl really only want''s to have fun. She doesn''t have a serious bone in her and lives to hear giggles. \n\nShe loves to fly and her favorite trick is picking up multiple discs. Her record is 12 at once, leading us to believe that she is part anaconda. She has taught me calm, and constantly reminds us not to take things too seriously. ', 1, '811_Keva_10_discs.jpg', 0, '2013-03-10 20:54:12', 1, '2013-04-01 14:41:25', 334, 0),
(812, 873, 333, 'Keva', '2010-02-23', 'BC Mix', 'Female', 0, 'Western Border Collie Rescue', '<p>Introducing Keva. We rescued her from Western Border Collie Rescue in Oct 2010, she was 9months old. From what we were told, she had a rough start to her life. She had some major trust issues with people and was very shy and afraid of everything. It was definitely a challenge for us, to bring her out of her shell. We learned calm and patience from her, and she learned that the world really wasn''t so scary. Being a part of the CDD, we had a whole big wonderful family to help us with her rehabilitation. Last year was the first true year that we all got to see her truly wonderful goofy personality. She just loves to have fun and make everyone around her giggle like crazy. Her favorite trick is to pick up as many discs as possible. Her record is 12 discs at once. She has gained the nickname "anaconda". She is the most fun, lovable and goofy little girl you''ll ever meet. Hope all of you that view this goofy dogs profile, will get a chance to come and see her perform at a show or competition. If your lucky she''ll come over and give you a big kiss!!!</p>', 1, '812_DSC_8824.JPG', 0, '2013-03-10 20:54:12', 1, '2013-08-25 22:55:48', 334, 0),
(813, 874, 412, 'Monkey', '2010-07-01', 'BC', 'Female', NULL, NULL, NULL, 0, '', 0, '2013-03-10 20:54:12', 1, '2013-03-10 20:54:12', 1, 0),
(814, 875, 283, 'Diva', '2010-11-11', 'BC', 'Female', 1, 'Life is Better', 'Diva, also one of out Border Collies fits the "Ditzy" logo. She is one goofy 2 yr old and doesn''t quite have that disc drive, she''s more interested in playing and being social right now but I''m hoping for a late bloomer. ', 1, '', 0, '2013-03-10 20:54:12', 1, '2013-04-02 11:34:51', 283, 0),
