(831, 892, 378, 'Macie', '2009-05-15', 'Aussie', 'Female', 0, '', 'Macie is an incredible three legged show stopper who has no quit in her.  She gives 100%all the time and loves any athletic event she can participate in.  She is a crowd favorite at every competition.  Macie lost her leg on her first birthday and it has not slowed her down at all.  Macie has taught me many lessons in life and brings me joy every day by sharing her life with me.', 1, '831_image1.jpg', 0, '2013-03-10 20:54:13', 1, '2013-07-22 23:28:35', 378, 0),
