(987, 1052, 431, 'Rocco', '2011-02-19', 'Australian Shepherd', 'Male', 0, 'Previous Owner', '<p>Rocco is the newest member of Team Green. A friend asked me if I could help someone who had an Australian Shepherd that was eating the walls, literally! I met with his previous owners and they wanted to make sure he went to a good home. He started out as a ''foster'', but soon won my heart as one of the sweetest, most comical dogs in my pack.</p>\n<p>Rocco will start his competitive career in 2013 at age 2. If anything, he sure is a funny guy and he doesn''t eat walls anymore!</p> ', 1, '987_rocco_1.jpg', 0, '2013-03-10 20:54:16', 1, '2013-09-09 22:21:49', 431, 0),
