(1014, 1081, 36, 'Murphy', '2009-07-01', '', 'Male', 0, '', 'Murphy is a rescued Lab/Doberman. He is awesome in the field and is an AKC Therapy titled dog. Sometimes he will come out and have a great day. He prefers to chase balls over discs. Murphy is amazingly smart and friendly.', 1, '1014_Murphy_1.jpg', 0, '2013-03-10 20:54:16', 1, '2013-05-04 17:59:22', 36, 0),
(1015, 1082, 19, 'Kylie', '2006-05-28', 'lab/golden', 'Female', 0, '', 'Kylie is the sweetest dog I have ever had. She is super smart but has an independent streak in her. She has been a therapy dog since 2008 and works with me at the mental health center in Durango. The clients and staff absolutely love her and there are definitely more people that know her than me! She has several agility titles (her favorite), Rally-O Excellent title, Canine Good Citizen and 2 titles in Musical Canine Freestyle. \nShe has made a full recovery from a total hip replacement January 2012 and now acts like a 2 year old again. She loves frisbee and has competed a couple times, just for fun. She is hoping to get back to agility now that her hip is all better, but will keep doing disc sports for fun. ', 1, '1015_frontkylie_ilp.JPG', 0, '2013-03-10 20:54:16', 1, '2013-07-13 18:28:02', 19, 0),
