(1054, 1121, 19, 'Chelsey', '2010-10-23', 'Border Collie/ Aussie', 'Female', 0, '', 'Chelsey is a 2 year old fun-loving B/C Aussie mix and actually belongs to my friend, Andrea. Chelsey did some pinch discing when her sister and my main disc dog, Kelsa, got injured last year. Chelsey still needs a lot of practice, but is really quite a natural. Can''t wait to work with her some more. ', 1, '1054_chelsey_disc.jpg', 0, '2013-03-10 20:54:17', 1, '2013-07-13 18:28:36', 19, 0),
