(1061, NULL, 233, 'Wally', '1992-06-30', 'Aussie', NULL, 0, '', '<p><span style="text-decoration: underline;"><strong>Wally</strong></span>&nbsp; [Captain Wallace Marvel, Fearless Freedom Fighter, Defender of Truth and Justice, 1992-2006] is the dog that got me into this sport.&nbsp; He was my second Australian Shepherd, and I knew from experience that I needed to find him a job or he would eat my house.&nbsp; A neighbor talked me into coming out to a playday, in spite of my protests about not being able to throw a frisbee.&nbsp; Wally liked it, I liked it, we were hooked.&nbsp; I traveled to Colorado a few times to compete with Wally in the Open Regionals, fell in love with the Rocky Mountains and moved here as soon as I could, so Wally is also responsible for me being here.&nbsp; This amazing dog taught me so much about life, the universe and everything. He completely transformed my life, and I am incredibly grateful.&nbsp; By the way, you get better at throwing a frisbee when you have a dog that demands to play every single day.</p>\n<p>Wally''s competitive career spanned 12 years, and I don''t remember all of his wins, but I do remember all of the fun we had and that''s what matters most.</p>', 1, '1061_wallydiscs.jpg', 0, '2013-03-31 22:59:07', 233, '2013-03-31 23:05:14', 233, 0),
(1062, 1128, 224, 'Radical RENCEE', '2011-06-18', 'Border Collie', 'Female', 1, 'Private Adoption, records are sealed.', '<p>Private adoption November 2012. A friend of a friend had a friend who got a dog for thier son&nbsp;becuase he&nbsp;wanted&nbsp;a fluffy dog. 16 months later the dog was to much energy. Stay tuned for more exciting news on Radical RENCEE! The name comes from the initials of Marie &amp; Darrel''s Fathers.</p>', 1, '1062_image.jpg', 0, '2013-04-01 15:11:16', 224, '2013-08-22 19:25:43', 224, 0),
(1064, 1134, 225, 'Radical RENCEE', '2011-06-18', 'Border Collie', 'Female', 1, 'Private adoption, the records are sealed.', '', 1, '1064_image.jpg', 0, '2013-04-02 00:05:10', 225, '2013-04-02 00:05:10', 225, 0),
(1065, 948, 52, 'Telluride', '2005-06-26', 'Labrador Retriever', 'Female', 0, '', 'Telluride (named after Telluride, Colorado) is a 8 year old labrador retriever. She was my first competition dog. For both Agility and disc. We mainly played in freestyle but often enjoyed a little toss & fetch. Tellie is semi-retired due to a knee injury back in June of 2012. She has fully recovered but she will not continue freestyle. She mainly competes in T&F.', 1, '1065_6033658952_949fc8d2fe_b.jpg', 0, '2013-04-02 20:50:05', 52, '2013-04-02 21:09:23', 52, 0),
(1066, 1038, 52, 'Karma', '2011-04-16', 'Border Collie ', 'Female', 0, '', 'Karma is a 2 yr old Border Collie. She currently competes in Agility, Freestyle, and starting herding. A disc nut for sure, she enjoys playing disc with just about anyone. She is a super friendly girl and is also in training for service dog. She is a member of the demo team so be sure to keep us out on the look out!! She mainly competes in freestyle and loves it.', 1, '1066_cool_pic_of_Karma.png', 0, '2013-04-02 20:55:46', 52, '2013-04-02 21:32:01', 52, 0),
(1067, NULL, 300, 'Bubba', '2003-04-10', 'Rez Dog or Heitz 57', 'Male', 1, 'Help for Homeless Pets', 'Bubba was suppose to be our 3rd frisbee dog but he doesn''t have the drive to play, he''s still an awesome dog and a Hero. Reuben picked him out from a cage as he was tossing younger puppies out of the feeding plate. He named him Sammy and I knew he was ours. As we were driving home, I picked up this football of a puppy, looked at him and said "I don''t care what he calls you, your name is Bubba", Bubba has little play drive, non athletic confirmation and is content to chew on a bone and even though he''s an indoor dog he prefers to be outside in the sun, rain or snow. Bubba is sweet as rain, balances my high drive pack and is abit dopey. Thats not an insult, its a statement of fact and is one of his many endearing qualities. At one time I thought he had nothing going on between his tiny ears but then I realized he gets a warm bed, premium dog food and gets to travel around the nation in an RV and even has his own place in the RV called Bubba Land. He gets everything those hard working frisbee dogs get and all he has to do is chew bones in the back yard, roll over for belly rubs and wander around sniffing on hikes and trips to the park. He''s not dumb, he''s the smartest one in the pack. When you meet Bubba, you will love him and he will love you. We are pretty sure Bubba came off the Crow reservation and is a Rez dog. The Rez dog tale can be sad, unaltered dogs roaming free, breeding unscrupulously, subjected to disease, illness and injury, often forced to eat whatever. Some lucky ones have a home but many do not. The one quality most Rez dogs share is they are often gentle toward humans because an aggressive free roaming dog on the Rez is simply shot on sight. So the Rez Dog is gentle toward people, hardy and their pedigrees are mixed with everything under the sun. Bubba''s one accomplishment has nothing to do with frisbee but saving a young girl. My god child, Ashlyn, had taken him to a local park near her house where she climbed a tree. She fell 15 to 20 feet hitting several branches that knocked her unconscious and the wind out her when she woke up, leaving her unable to call for help. Bubba ran to the nearest person and began barking and hopping until they followed him to where she lay in the tall grass. No one would have seen her without his help. Ashlyn was alright, needed some stitches and was terribly bruised but we still consider Bubba our Hero Dog.', 1, '1067_IMG_0122.jpg', 0, '2013-04-03 02:07:40', 300, '2013-06-09 01:13:37', 300, 0),
(1068, 1133, 245, 'Sara', '2011-12-22', 'Lab/BC/boxer/terrier', 'Female', 1, 'Boulder Humane Society', 'Sara will have her debut this year as our newest frisbee dog. Found roaming the streets of Kansas as a stray, we adopted this frightened little girl in May 2012 from Boulder Human Society. Turns out, she is the best dog ever! Super kid and people friendly and loves to play frisbee! DNA testing revealed that she was 50% lab/BC mix and 50% mixed breed that contains some boxer and some terrier. She is strong and fast-we are looking forward to a fun season back in the frisbee world!', 1, '1068_IMG_9205.JPG', 0, '2013-04-08 18:16:32', 245, '2013-04-08 18:26:31', 245, 0),
(1069, 1034, 36, 'Sweet Sage', '2010-05-19', 'Belgian Malinois', 'Female', 0, '', 'Sage is an amazing pure bred Belgian Malinois. She has incredible drive and focus. Her determination and loyalty makes her a great team mate and family member. Her talents carry the team! We love "Sweet Sage"', 1, '1069_Sage_Trophys.jpg', 0, '2013-04-09 21:39:28', 36, '2013-04-09 21:53:10', 36, 0),
(1071, 884, 72, 'Scout', '2009-04-15', 'Border Collie', 'Male', 0, '', 'Scout is a high drive border collie, has a big drop problem, out of Lockeye Border Collie Kennels..........................  Love this Dog.', 1, '1071_Frisbee_10_2012-42.jpg', 0, '2013-05-04 09:29:30', 72, '2013-05-22 08:18:43', 72, 0),
(1072, 882, 72, 'Sadie', '2010-08-19', 'Border Collie', 'Female', 0, '', 'Sadie is from a breeder in Taos, NM, I saw her as a puppy and when my wife said I wouldn''t be mad if you brought her home, I was hooked.\n\nShe is fast, quick, a fair jumper, very high drive, with a classic BC working manner.\n\nShe''s gonna be good if I don''t screw her up.  In the picture she is admiring Big Air Bella, Todd Murnan''s beauty.', 1, '1072_Sadie_alb.jpg', 0, '2013-05-04 09:34:08', 72, '2013-05-22 08:19:04', 72, 0),
(1073, 885, 72, 'Seamus', '2003-11-30', 'Mini Australian Shepard', 'Male', 0, '', 'Seamus was my wife''s 50th''s birthday present, I had other frisbee dogs at the time and didn''t really play with him for his first 5 years.  Then I threw him a frisbee and he did a perfect flip.  His a little guy, with a big heart and drive.  Was absolutely the cutest puppy ever, and still maintains his looks and drive in his 9th year.', 1, '1073_Seamus2.gif', 0, '2013-05-04 09:38:58', 72, '2013-05-22 08:19:23', 72, 0),
(1074, NULL, 36, 'Kona', '2013-04-14', 'Belgian Malinois', 'Male', 0, '', 'Kona is a very energetic Malinois. He has a great personality and a very high drive. He loves to catch a disc! This is his first year with CDD.', 1, '1074_Kona_3.jpg', 0, '2013-05-04 17:42:56', 36, '2013-05-04 17:56:33', 36, 0),
(1075, 1137, 10, 'Sydney', '2005-12-02', 'Aussie', 'Female', 1, '', 'Sydney is a hurricane Wilma rescue and is an Aussie with a tale.  She is our first sport dog and compets in Flyball, Agility and Dock Diving besides Disc.  She also love to herd sheep and finds it fun to break up the sheep and bring them to you one at a time. Her nicknames are Silly Zilly Vanilly and Sydney McBitchie.  Loves all, especially kids who are willing to play any type of ball or disc with her.', 1, '1075_syd_disc.jpg', 0, '2013-05-06 16:19:38', 10, '2013-05-06 22:23:57', 10, 0),
