(82, 11, 0, '', 'Spring Spree Mix Up', '2013-06-16', 2013, 0, 'Memorial Park, Colorado Springs', '38.8330458, -104.79766089999998', '<h2>Springs Spree Day 2</h2>\n<p>Over 70,000 people attended Springs Spree weekend last year and yes folks, the masses have asked for more disc dog fun. On Sunday June 16<sup>th</sup>, the Colorado Disc Dogs deliver. Come try your hand at a variety of disc games that are planned.</p>\n<p>&nbsp;</p>\n<h4>Mini Distance</h4>\n<p>&nbsp;</p>\n<p>The first event of the day is a throw back event honoring the old Lyons format. For those of you that aren&rsquo;t familiar with this format this is a true Mini Distance Toss and Catch event.&nbsp; Like usual, teams will have 60 seconds to get as many throws off as possible. The main difference here is the size of the field. We will be using a field that is only 20 yards long. So if you ever thought, jeez I can&rsquo;t compete against the teams that can sniper the long throws, this is your chance to level the playing field.</p>\n<p>The scoring zones are as follows:</p>\n<p>0-5 yards&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 0 points</p>\n<p>5-10 yards&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1 point</p>\n<p>10-15 yards&nbsp;&nbsp;&nbsp; 2 points</p>\n<p>15-20 yards&nbsp;&nbsp;&nbsp; 3 points</p>\n<p>20+&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4 points</p>\n<p>All four paws must be across the line to score in the higher zone and an extra &frac12; point will be awarded for all four paws in the air.</p>\n<h4>&nbsp;</h4>\n<h4>NOBA Mini Distance</h4>\n<p>For this event we&rsquo;ve put a twist on the Mini Distance format. The rules are the same as above with a few minor differences. There will be NO BAckhand throws allowed and NO repeat throws. Handlers must use a different throw each time. No backhands apply to both the right and left hand, however all other throws can be done using either hand to count as a different throw. So break out those scoobers, thumbers, tomahawks, and any other throw you can think of.</p>\n<h4>&nbsp;</h4>\n<h4>Long Distance</h4>\n<p>You say you want to throw long. This is your chance to shine. For this event we will be using a format similar to the UFO Longshot. All teams will start out throwing in order form 40 yards out. The catch must be made across the catching line (where the front feet touch down during the catch, or after the line, if caught in mid-air).&nbsp; Each team that successfully completes a catch will move up to the next distance. If your dog makes the catch across the catching line, you stay in. Each miss counts as a strike. Each team has 3 misses for the whole game. A throw will be scored a miss if they miss the catch OR if they miss the distance (ie, the catch is NOT across the catch line). If a team misses, they IMMEDIATELY make a second try. Misses are cumulative, so if you miss once at one distance, that miss WILL count against you if you miss a second time a longer distance. Once a team gets their 3rd miss, they are out. This will continue until there is only one team left, our winners</p>\n<p>The progression of distance is expected to increase by 5 yards for each successive round but may change depending on if we run into time constraints.</p>\n<p>For all events there are only two divisions. The playing division and the Spectators. Second rounds for each event will be determined &ldquo;day of&rdquo; based on the number of teams competing and available time. Spectators will be able to enjoy watching disc dog action.</p>\n<p>Registration will be from 7:30-8:30. The competition will begin at 9am.</p>\n<p>Registration for the events above is $5.00 per team per event. You can choose to play just your favorite event or give em all a try.</p>\n<p>&nbsp;</p>\n<h4>Mini Disc 50/50 Skill Shot</h4>\n<p>As an added bonus you can also try your hand at the Mini Disc 50/50 Skill shot. For this you&rsquo;ll need to purchase a mini disc at registration. Before lunch we&rsquo;ll give the dogs a break and see who can sink a shot with the mini&rsquo;s in a disc golf basket. All throws must be made from behind the flags surrounding the field. So get there early to pick a prime spot or start making friends with people in prime spots. The winner splits the pot. If there is more than one basket made, we will hold a shoot out from increasing distances. If no one makes the basket, the closet disc to the center of the basket wins.</p>\n<p>Mini-Discs and a chance at the prize can be purchased for $2/per disc or 3 discs for $5. Make sure to put you name on the disc. Discs with no names will not count towards the prize. Winners will be announced after the Long distance event.</p>\n<p>&nbsp;</p>\n<p>For those that are competing on Saturday, tents can be left on site over night. There will be security for the festival, however it is recommended that all valuables be removed.</p>\n<p>&nbsp;</p>\n<p>For questions, contact Brian White at bobo-n-koko@comcast.net</p>', '', '', '', '', '', 0, '', '', 0, NULL, '2013-06-06', '2013-06-13', 1, 'spring-spree-mix-up-06-16-2013', '2013-05-05 21:30:50', 334, '2013-09-28 12:50:44', NULL, 0),
(90, 3, 0, '', 'TEst Event', '2014-02-25', 2014, 1, 'Red Rocks CO', '38.57443000000001, -107.8056158', '<p>sadasdasdsadsdadasd</p>', '', '', '', '', '', 0, '', '', 0, '', '0000-00-00', '0000-00-00', 1, 'test-event-2014-02-25', '2014-02-22 11:13:01', 431, '2014-02-22 11:13:01', 431, 0),
(86, 1, 0, '', 'Test Event', '2014-01-11', 2014, 1, 'Cornerstone Park Littleton CO', '39.622384, -105.00319389999999', '<p>Spring Training is coming! Don''t miss your chance to come out and get ready for the upcoming season. Learn from the pros in this valuable and fun clinic! If you''ve ever thought you might like to give the whole frisbee dog thing a try, this is the time and place to do it. Whether you have no experience, a little, or a lot -- there''s plenty for everyone!</p>\r\n<p>&nbsp;<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />As in past years, we will work on everything from the basics to the more advanced topics. We will again also offer 15 minute ''private lessons'' giving you a chance to work one-on-one with our most experienced teams on any specific issues you desire.&nbsp;<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" /><br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />The cost is $25 per team, or $35 for a family (multiple handlers or dogs). You will receive a competition-approved Wham-o "Fastback" frisbee with your registration.<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />The private lessons are $10 for each 15 minute session.</p>\r\n<p>Contact codiscdogs@comcast.net for more information.<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" /><br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />Hope to see many of you on Saturday, May 11th!! Be sure to bring your dog, your leash, water, and umbrella!</p>\r\n<p>&nbsp;</p>\r\n<p>Look for us at 3201 W. Oxford, behind the school and near the skate park.<br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" /><br style="color: #000099; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-weight: bold;" />Spring Training Schedule:</p>\r\n<ul>\r\n<li>12:30 pm - registration opens</li>\r\n</ul>\r\n<ul>\r\n<li>1:00 pm-Spring training begins.</li>\r\n</ul>', '', '', '', '', '', 0, '', '', 1, '', '2014-01-10', '2014-01-12', 1, NULL, '2014-01-12 02:46:15', 431, '2014-02-01 02:39:37', 431, 0),
