INSERT INTO `notification` (`id`, `group_id`, `subject`, `body`, `created`, `created_by`, `modified`, `modified_by`) VALUES
(1, 3, 'This is test message', 'This is the body of the message.', '2014-01-31 21:10:49', 431, '2014-01-31 21:10:49', 431),
(2, 3, 'This is a second message', 'This is a second message', '2014-01-31 22:13:02', 431, '2014-01-31 22:13:02', 431),
(3, 3, 'Welcome to the CDD Message Center', '<h2>Announcement from CDD!</h2>\r\n<p>We just launced some new features on the CDD web site! Welcome to the message center. Here you will receieve notifications from the officer group in regards to club business. When you log into the site, you will see a new featured menu item called ''Messages'', this will let you know when you have new messages. As well, you may also elect to reveice an email when messages are sent. If you would like to opt into the email, please visit you Account Settings page. </p>\r\n<p><br />We are also exploring the idea of sending notifications when registration opens or closes for competitions and other events. Please let us know if you have any questions or concerns. If you opt to receive email, please make sure admin@coloradodiscdogs.com is not blocked as spam. You may opt out of email alerts at anytime.</p>', '2014-02-01 14:27:07', 431, '2014-02-01 14:27:07', 431);
