INSERT INTO `page` (`id`, `isHome`, `name`, `description`, `slug`, `start_date`, `end_date`, `automated`, `created`, `created_by`, `modified`, `modified_by`, `deleted`) VALUES
(19, 0, 'Points Guide', '<p><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></p>\n<h2 style="text-align: center;">&nbsp; <span class="tabletextbluebig">Colorado Cup Points Series Guide</span></h2>\n<h2 class="MsoNormal" style="text-align: center;" align="center"><em>"The State Championship Series"</em></h2>\n<p class="MsoNormal" style="text-align: justify;">The Colorado Disc Dogs recognize several awards each season based on a Points Series</p>\n<ul>\n<li>The State Champion</li>\n<li>Rookie of the Year</li>\n<li>Hershet Memorial Award</li>\n<li style="text-align: justify;">Red Rocket Freestyle Award</li>\n</ul>\n<p class="MsoNormal" style="text-align: justify;">Points are accumulated from placings at Colorado Disc Dogs events. All events run by the Colorado Disc Dogs are opportunities for teams to accumulate points towards these titles. Teams must be from Colorado to receive points. The team with the highest point total at the end of the club season will be declared the "Colorado State Champions". Any team can win the State Championship title.</p>\n<p class="MsoNormal" style="text-align: justify;"><br /> The total points added up will include the top 6 point-awards from the season. For teams that travel to all 7 events, their single lowest point-awards for the season will be dropped. For teams that participate in 6 or fewer events, all of their point-awards for the season will be counted, and none will be dropped.</p>\n<p class="MsoNormal" style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><strong>Rookie of the Year Award</strong></p>\n<p style="text-align: justify;">This award is recognition of the best new handler and dog team in the state each year. The Qualification for Rookie status is that the handler must not have competed prior to January 1st of the calendar year for that season. The handler may use a dog that has competed before, however, the recognition is awarded to the pair as a team.<br /> The Rookie of the Year (RotY) award is based on the regular CDD points series. The points that Rookie teams earn in the Colorado State Championship series (The ''Colorado Cup'') are tracked for Rookie teams. At the end of the season, the team with the most points is declared "Rookie of the Year."<br /> Ties for the RotY are not broken. In the event of a tie for first place in the series, both teams will be declared co-champions.</p>\n<p>&nbsp;</p>\n<p><strong>Hershey Memorial Award</strong></p>\n<p style="text-align: justify;">This award is recognition of excellence at the short distance events, often called "MiniDistance." This award is given to the team with the highest total of their single best round in Skyhoundz Distance/Accuracy and their single best round in UFO Throw and Catch. In the event of a tie, the tie breaker will be the 3rd highest scoring round, followed by the 4th highest, etc.</p>\n<p>&nbsp;</p>\n<p><strong>Red Rocket Rider Freestyle Award</strong></p>\n<p style="text-align: justify;">This award is recognition of excellence at Freestyle events. This award is given to the team with the highest total of their single best round in Skyhoundz Freestyle and their single best round in UFO Freestyle. In the event of a tie, the tie breaker will be the 3rd highest scoring round, followed by the 4th highest, etc.</p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>&nbsp;</strong></span></p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>Open Division/Freestyle Point Scale</strong></span></p>\n<p class="MsoNormal" style="text-align: justify;">Any event with two complete rounds of competition that includes Freestyle. Not to include Novice, Intermediate, or Advanced category competitions (see respective point scales below). May also include special events with only one division.</p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>&nbsp;</strong></span></p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>Advanced / MiniDistance Point Scale</strong></span></p>\n<p class="MsoNormal" style="text-align: justify;">Advanced category MiniDistance competitions (one or two rounds). MiniDistance includes events such as Distance/Accuracy and Throw and Catch.</p>\n<p>&nbsp;</p>\n<p class="MsoNormal"><span class="tabletextred2"><strong>Intermediate / MiniDistance Point Scale</strong></span></p>\n<p class="MsoNormal" style="text-align: justify;">Novice category MiniDistance competitions (one or two rounds). MiniDistance includes events such as Distance/Accuracy and Throw and Catch.</p>\n<p class="MsoNormal">&nbsp;</p>\n<p class="MsoNormal"><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></p>\n<div align="center">\n<table border="1" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td colspan="5" width="305">\n<p align="center"><strong>Points by Division</strong></p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center"><strong>Place</strong></p>\n</td>\n<td width="59">\n<p align="center"><strong>Open</strong></p>\n</td>\n<td width="59">\n<p align="center"><strong>Advanced</strong></p>\n</td>\n<td width="68">\n<p align="center"><strong>Intermediate</strong></p>\n</td>\n<td width="59">\n<p align="center"><strong>Novice</strong></p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center">1</p>\n</td>\n<td width="59">\n<p align="center">200</p>\n</td>\n<td width="59">\n<p align="center">175</p>\n</td>\n<td width="68">\n<p align="center">130</p>\n</td>\n<td width="59">\n<p align="center">115</p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center">2</p>\n</td>\n<td width="59">\n<p align="center">195</p>\n</td>\n<td width="59">\n<p align="center">170</p>\n</td>\n<td width="68">\n<p align="center">127</p>\n</td>\n<td width="59">\n<p align="center">112</p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center">3