bsp;</p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center">56</p>\n</td>\n<td width="59">\n<p align="center">10</p>\n</td>\n<td width="59">\n<p align="center">1</p>\n</td>\n<td width="68">\n<p align="center">&nbsp;</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center">57</p>\n</td>\n<td width="59">\n<p align="center">8</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n<td width="68">\n<p align="center">&nbsp;</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center">58</p>\n</td>\n<td width="59">\n<p align="center">6</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n<td width="68">\n<p align="center">&nbsp;</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center">59</p>\n</td>\n<td width="59">\n<p align="center">4</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n<td width="68">\n<p align="center">&nbsp;</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center">60</p>\n</td>\n<td width="59">\n<p align="center">2</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n<td width="68">\n<p align="center">&nbsp;</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n</tr>\n<tr>\n<td width="59">\n<p align="center">61+</p>\n</td>\n<td width="59">\n<p align="center">1</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n<td width="68">\n<p align="center">&nbsp;</p>\n</td>\n<td width="59">\n<p align="center">&nbsp;</p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p class="MsoNormal">&nbsp;</p>\n<p class="MsoNormal"><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:DoNotOptimizeForBrowser/>\n </w:WordDocument>\n</xml><![endif]--></p>\n<p style="text-align: justify;">Ties (at events) will be dealt with as follows. People tied will have their Colorado Cup Points added together, and divided by the number of people tied. Example: There is a tie for 4th place among 2 people. The points for fourth and fifth are added (8 + 7 = 15) and then divided by 2, to get 7.5 points for each person. <br /> <br /> Ties in the Colorado Cup points standings are not broken. <br /> <br /> Out of state competitors are not eligible for points. Their placement at individual events will be skipped for the purpose of doling out points.</p>\n<p style="text-align: justify;"><em><span style="font-size: 12.0pt; font-family: ''Times New Roman''; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">Remember-Membership in the Colorado Disc Dogs is required to earn points for CDD standings. Points will only be earned when membership is paid in full. Points will NOT be retroactively applied to a team''s standing.</span></em></p>\n<p style="text-align: justify;"><em><span style="font-size: 12.0pt; font-family: ''Times New Roman''; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"><em>Rookie teams-that is, people competing for the first time, are all given "Provisional Membership". This is free limited membership in the Colorado Disc Dogs for the teams first season in order to track Cup points. These teams will earn points in the Colorado State Championship Series. The highest finishing team of this group will be declared the Rookie of the Year. <br /></em></span></em></p>\n<p style="text-align: justify;"><em><span style="font-size: 12.0pt; font-family: ''Times New Roman''; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;"><em>Provisional Members are not eligible for the same benefits as paid members, such as discounts and voting privileges. Provisional members may apply for paid membership at any time.<br /></em></span></em></p>\n<p>&nbsp;</p>', 'points-guide', NULL, NULL, 0, '2013-02-18 20:52:54', 1, '2013-04-13 01:40:04', 334, 0),
(22, 0, 'Membership', '<p>You don&rsquo;t have to be a member to play at any of our events. We welcome everyone who wants to play with their pups. But as the saying goes, membership does have its advantages.</p>\n<p><strong>Members receive:</strong></p>\n<ul>\n<li>Discounts on disc orders and select merchandise.</li>\n<li>Discounted entry fees at select events.</li>\n<li>Earn points towards the State Championship Series. <em>Points will only be earned when membership is paid in full. Points will NOT be retroactively applied to a team''s standing</em></li>\n<li>Voting privileges for club positions and general club issues.</li>\n<li>Discounted or Free year-end banquet.&nbsp;</li>\n<li>Eligible for prizes and giveaways.</li>\n<li>Access to customizable profile page</li>\n</ul>\n<p><em>*All discounts are subject to change and restrictions may apply</em></p>\n<p>&nbsp;</p>\n<p><strong>What&rsquo;s required to be a member?</strong></p>\n<p>Membership requires that you be present at least one sanctioned CDD event and that membership fees are paid in full. Membership Application Forms are available upon request at any of our events; just stop by the registration tent.</p>\n<p>Members are expected to act in accordance with CDD Bylaws. A copy of the Bylaws can be found on the coloradodiscdogs_obl list or by request.</p>\n<p>&nbsp;</p>\n<p style="text-align: center;"><span style="text-decoration: underline;">Costs </span></p>\n<p style="text-align: center;">Individual Membership&nbsp;&nbsp;&nbsp;&nbsp; $20</p>\n<p style="text-align: center;">Couples Membership&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $35</p>\n<p style="text-align: center;">Family Membership&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; $45</p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>Provisional Membership:</strong></p>\n<p>Rookie teams-that is, people competing for their first season are all given "Provisional Membership". This is free membership in the Colorado Disc Dogs for a team&rsquo;s first season for the purpose of earning points in the Colorado State Championship Series.</p>\n<p>Provisional Members are typically not eligible for discounts and voting privileges associated with a paid membership. Provisional members must apply for paid membership to receive additional membership privileges.</p>\n<p><em>Colorado Disc Dogs is a non-profit group. Membership fees are used to help offset the costs associated with running events such as field fees, insurance, and trophies.</em></p>', 'membership', NULL, NULL, 0, '2013-05-07 00:32:27', 334, '2013-05-07 00:38:13', 334, 0),
(20, 0, 'Results', '<p>Results from our competitions are displayed below. Each year, members of the Colorado Disc Dogs compete for Cup points. Check out the <a title="Points Guide" href="page/Points-Guide">points guide</a> for more details on the Colorado Cup Series.</p>', 'results', NULL, NULL, 1, '2013-03-23 17:14:42', 1, '2013-03-31 22:58:41', 1, 0),
(21, 0, 'Standings', '<p>Check out how the Colorado Cup Series is shaping up!</p>', 'standings', NULL, NULL, 1, '2013-03-31 18:44:23', 1, '2013-03-31 18:44:23', 1, 0),
(23, 0, 'Privacy Policy', '<p>Our website collects names, email addresses, and other personal information from customers and visitors only when submitted via one of our online forms, such as our subscription form, mailing list registration form or competitions. This data is used solely by coloradodiscdogs.com and is not shared, traded, or sold to third parties.</p>\n<p>Members can edit their personal information by logging into our site OR by sending an email to request account changes to admin@coloradodiscdogs.com.</p>\n<p>Our website also collects non-personal data through the use of server-based "session variables," which we use to achieve important site functionality, including the recognition of logged-in users and the secure passing of shopping cart information. In order to identify members as they proceed through the check out process, our website also uses a single &ldquo;cookie&rdquo; (a small file stored by your browser on your hard drive); thus, online transactions require a browser that accepts &ldquo;cookies.&rdquo;<br /><br />Our web-server also records IP addresses from all visitors to our site. An IP address is a number that is automatically assigned to your computer when you use the Internet. We use IP addresses to help diagnose problems with our server, to administer our site, to analyze trends, to track user movement, and to gather broad demographic information&mdash;all for the purpose of continually improving our website and delivering personalized, custom content. IP addresses are not linked to personally identifiable information, and their collection is standard procedure in most web-server environments.<br /><br />Our website contains links to other websites. Please note that when you click on one of these links, you are entering another website, for which coloradodiscdogs.com is not responsible.<br /><br />By using coloradodiscdogs.com, you signify your agreement to our privacy policy as stated above. Note that this policy may be revised periodically without notice. Please re-read this policy prior to submitting any personal information if you have concerns about how your information is being collected and used.</p>', 'privacy-policy', NULL, NULL, 0, '2013-05-09 01:43:32', 431, '2013-05-09 02:01:28', 431, 0),
(24, 0, 'Rescue Row at the Colorado Canine Challenge', '<h1 style="text-align: center;">&nbsp;&nbsp;&nbsp;&nbsp; <strong>COLORADO DISC DOGS</strong><em>&nbsp;</em></h1>\n<h2 style="text-align: center;">Colorado Canine Challenge&nbsp;</h2>\n<h2 style="text-align: center;" align="center"><strong>August 3, 2013</strong></h2>\n<h2 style="text-align: center;" align="center"><strong>Cornerstone Park</strong></h2>\n<h2 style="text-align: center;" align="center"><strong>Littleton, CO</strong>&nbsp;</h2>\n<p><strong>&nbsp;</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p>The Colorado Disc Dogs would like to invite your organization to join on us Saturday, August 3, 2013 at Cornerstone Park in Littleton, Co.&nbsp; The members of CDD are firm believers in rescue units and we extend this invitation to your rescue organization to get your cause and your dogs in the public eye.&nbsp;</p>\n<p>The Colorado Canine Challenge is the CDD premier event.&nbsp; This event attracts over 100 competitors from all states.&nbsp;&nbsp; The public is invited to join us and cheer on their favorite athlete as they exhibit their incredible talents.&nbsp;&nbsp;&nbsp;</p>\n<p>There is no cost to your organization. There will be a designated area near our competition fields called RESCUE ROW.&nbsp; Please supply your own staff, tents, tables, chairs, banners, water, containment, promotional items and of course your available dogs.&nbsp;</p>\n<p>&nbsp;</p>\n<p>For more information please contact:</p>\n<p>Marie Earle</p>\n<p>CDD Coordinator</p>\n<p>4946 E. 124<sup>th</sup> Way</p>\n<p>Thornton, CO 80241</p>\n<p>C: 303 929 4034</p>\n<p>&nbsp;<a href="mailto:Mearle3@Hotmail.com">Mearle3@Hotmail.com</a></p>\n<p><a href="http://www.coloradodiscdogs.com/">www.coloradodiscdogs.com</a></p>', 'rescue-row-at-the-2013-ccc', NULL, NULL, 0, '2013-06-27 19:53:17', 224, '2013-08-22 16:10:22', 224, 1);
