(25, 0, 'Bark for Art, Saturday 09/28/13', '<p>The Colorado Disc Dog Demo Squad will be performing at...</p>\n<p><a href="http://www.greenwoodvillage.com/index.aspx?NID=1669">http://www.greenwoodvillage.com/index.aspx?NID=1669</a></p>\n<p>Greenwood Village Arts and Humanities Council proudly presents the 2nd annual fundraiser, Bark for Art dog walk and art festivities.&nbsp; All funds raised will benefit the arts and art education in the community.&nbsp;</p>\n<div><span style="color: #685e42; font-size: 10pt;">Come check out the artists, art demos and activities, tasty treats, face painting, fortune telling, dog costume contest, pet adoption, pet grooming, dog treats and more.&nbsp; Show your support for the arts by joining the morning stroll in the award winning, public art filled picturesque Westlands Park.</span></div>\n<div>\n<div>&nbsp;</div>\n<div><span style="color: #685e42; font-size: 10pt;"><span style="color: #44837c;"><strong>WHERE:</strong></span> Westlands Park 5701 South Quebec Street</span></div>\n</div>\n<div style="font: small/normal Arial; color: #000000; text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: #ffffff; -webkit-text-stroke-width: 0px;">\n<div>\n<div>&nbsp;</div>\n<div>\n<div>&nbsp;</div>\n<div>&nbsp;</div>\n<div><span style="color: #685e42; font-size: 10pt;"><strong><span style="color: #44837c;">WHEN:</span></strong><span class="Apple-converted-space" style="font-size: 10pt;">&nbsp; September 28, 2013</span><span class="aBn" style="top: 2px; font-size: 10pt; border-bottom-color: #cccccc; border-bottom-width: 1px; border-bottom-style: dashed; position: relative; z-index: -1;" data-term="goog_1550880386">eptember 28, 2013 from 8 a.m. noon</span></span></div>\n<div>\n<div>&nbsp;</div>\n<div><span style="color: #685e42; font-size: 10pt;">Check-in starts at 7:30 a.m., which includes coffee, bagels and live music by Band Dynamics with the </span></div>\n<div><span style="color: #685e42; font-size: 10pt;">walk beginning at<span class="Apple-converted-space" style="font-size: 10pt;"> 8 a.m</span>.<br /></span>\n<div><span style="color: #685e42; font-size: 10pt;"><span style="color: #44837c;"><strong>REGISTER:</strong></span> Online at</span><a class="Hyperlink" href="http://www.greenwoodvillage.com/barkforart" target="_blank"><span style="color: #00493f; font-size: 10pt;">www.greenwoodvillage.com/barkforart</span></a></div>\n<div><span style="color: #685e42; font-size: 10pt;">Fee: $12 per person. Dogs and kids under 3 are free</span></div>\n<div><span style="color: #685e42; font-size: 10pt;">Registration includes Bark For Art gift, fun-filled goody bag, entertainment, art activities, live music and fun give-a-ways. </span></div>\n</div>\n</div>\n</div>\n</div>\n<div>&nbsp;</div>\n<div>\n<div><span style="color: #685e42; font-size: 10pt;"><span style="color: #44837c;"><strong>ENTERTAINMENT</strong></span> will include:</span></div>\n<ul>\n<li>\n<div><span style="color: #685e42; font-size: 10pt;">LiveMusic by 3DC and Band Dynamics</span></div>\n</li>\n<li>\n<div><span style="color: #685e42; font-size: 10pt;">Frisbee Dog Show by Colorado Disc Dogs </span></div>\n</li>\n<li>\n<div><span style="color: #685e42; font-size: 10pt;">Circus Artistry Show by Snowflake Circus </span></div>\n</li>\n<li>\n<div><span style="color: #685e42; font-size: 10pt;">Greenwood Village Canine Unit Demonstration </span></div>\n</li>\n<li>\n<div><span style="color: #685e42; font-size: 10pt;">Dog Costume Contest- prizes awarded</span></div>\n</li>\n<li>\n<div><span style="color: #685e42; font-size: 10pt;">A Wagging Dog Success by Vicky Kirkland and her amazing dog Bronco and friends. </span></div>\n</li>\n</ul>\n</div>\n<div>\n<div style="font: small/normal Arial; color: #000000; text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: #ffffff; -webkit-text-stroke-width: 0px;"><span style="color: #685e42; font-size: 10pt;"><span style="color: #685e42; font-size: 10pt;"><span style="text-decoration: underline;"><strong><span style="color: #44837c; font-size: 10pt;">Vendor/Artists Participating:</span></strong></span></span></span>\n<div>&nbsp;</div>\n</div>\n<div style="font: small/normal Arial; color: #000000; text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; font-size-adjust: none; font-stretch: normal; background-color: #ffffff; -webkit-text-stroke-width: 0px;">\n<table width="100%" cellspacing="1" cellpadding="2">\n<tbody>\n<tr>\n<td><a class="Hyperlink" href="www.maxfund.org" target="_blank">MaxFund Mobile Pet Adoption Unit</a></td>\n<td><a class="Hyperlink" href="www.vcahospitals.com/orchard" target="_blank">VCA<span style="font-family: Arial; font-size: 10pt;">Orchard</span><span style="font-family: Arial; font-size: 10pt;">Animal Hospital</span></a></td>\n<td><a class="Hyperlink" href="www.emilyswagsandwhiskers.com" target="_blank">Emily''s Wags and Whiskers</a></td>\n</tr>\n<tr>\n<td><a class="Hyperlink" href="www.arttoeducate.com" target="_blank">Haiti Art, Melissa Connor</a></td>\n<td><a class="Hyperlink" href="www.robinfayegatesart.com" target="_blank">Robin Faye Gates Art</a></td>\n<td><a class="Hyperlink" href="www.krystalreedphotography.com" target="_blank">Krystal Reed Photography</a></td>\n</tr>\n<tr>\n<td><a class="Hyperlink" href="www.cooltreatsfordogs.com" target="_blank">Bear and Rat Cool Treats</a></td>\n<td><a class="Hyperlink" href="e-mail" target="_blank">Bass Hollander, Airbrush Portraits</a></td>\n<td><a class="Hyperlink" href="www.ebcatering.com" target="_blank">Einstein Bros Bagels</a></td>\n</tr>\n<tr>\n<td><a class="Hyperlink" href="www.communitysailing.org/" target="_blank">Community Sailing of Colorado</a></td>\n<td><a class="Hyperlink" href="e-mail" target="_blank">Fortune Telling, Lisa 