(19, '', 'AirKelsa', '2add308b256b709e82ee32a40bdce9ba82c0be77', NULL, 'dogshappen@gmail.com', 0, NULL, NULL, NULL, NULL, 0, 1377195226, 1, 'Jenni', 'Berkman', 'Jenni Berkman', 'Berkman, Jenni', '695 Fox Farm Cir', 'Durango', 'CO', '81122', '(970) 946-6366', '', NULL, 689, '2013-04-01', '19_back_vault_small2.jpg', NULL, 'I have always wanted a "frisbee dog" and stumbled on CO disc dogs, when I realized I had a prodigy on my hands with Kelsa, my now 2 year old Border Collie/Aussie! It would be an understatement to say I was blown away and truly addicted after Kelsa won the very first competition we ever entered in toss & catch!! I have to admit, she had puppy discs and I was throwing rollers from the very beginning, when I got her at 8 weeks old, but I never knew it would be this much fun! \n\nI have been competing in dog sports since 2007, including agility, obedience and canine musical freestyle. I have also been a trainer and started a therapy dog program, where I work at a community mental health center in Durango. I am currently studying to be a licensed social worker with an animal assisted therapy certificate and both my dogs are certified as therapy dogs with Therapy Dogs International. \n\nI am so glad we found this sport and this club, because it''s an awesome group of people and we had so much fun during our first year in 2012 and can''t wait for the 2013 season! ', 1, 'Public', 0000, 'jenni-berkman', 0, '2013-03-10 20:29:55', 1, '2014-02-09 18:02:07', 431),
