(52, '', 'TeamKarma', '67700179dff277bdd90fe43ec6e95ed79dddf77e', NULL, 'daytimeshadows@yahoo.com', 0, NULL, NULL, NULL, NULL, 0, 1376857297, 1, 'Brooklynn', 'Pogue', 'Brooklynn Pogue', 'Pogue, Brooklynn', '14522 Cherry St', 'Brighton', 'CO', '80602', '303-818-7179', '', NULL, 639, '2013-05-11', '52_1176364_10201414566301261_617877447_n.jpg', NULL, 'Hello, I''m Brooklynn. I''ve been with CDD since 2010. Training dogs since I was 7 years old. (owning a business at the age of 15) I fell in love with dog sports. I currently train  for service training, disc and agility. Looking around for something to get involved with, I stumbled upon the Colorado Disc Dogs. Met them all at a competition and loved the club from the start. I mainly compete in Freestyle but often enjoy a few rounds of toss and fetch. Dog sports have become a huge part of my life. I''m currently in training to become a police officer (K9). I am also a member of the demo team. You will see us around not only in competiton but also to show you about our amazing sport. Thank you for stopping by our profile and get out and play!', 1, 'Public', NULL, 'brooklynn-pogue', 0, '2013-03-10 20:29:55', 1, '2014-02-09 18:02:22', 431),
