(224, '', 'mearle3', 'c49d432997d499fbf3ee99c274805844321fce14', NULL, 'mearle3@hotmail.com', 0, NULL, '6c7e47988b8d98a0989fc1ee0bf67000eb380e50', 1372376748, '0f1a20ab8d8d56b449530eaad2565b2ec2a2c847', 0, 1381437386, 1, 'Marie', 'Earle', 'Marie Earle', 'Earle, Marie', '4946 E 124th Way', 'Thornton', 'CO', '80241', '303-929-4034', '(303) 929-4034', 2, 240, '2013-05-11', '224_Comfy_K9.jpg', NULL, 'My first Disc Dog was BO, German Shepard Mix.  Her and I started in 1998 after asking that simple question,How do I get my dog to do that?  Now here I am many years later and though BO is gone from my living life she leaves me a better person and on my fourth Disc Dog.\nThanks to the sport of Disc Dogs, I have experienced many things. I have traveled, made new friends all over America, been on television and now I get asked, How do I get my dog to do that?  Currently I hold the position of CDD Demo Team Coordinator, the task of lining up Demo Teams for Performances that CDD has been asked to appear for.  By weekday I am an accountant, by weekend I''m that crazy dog lady.  The dogs and I are busy during the Summer our weekends are booked either with a competition or a performance.  \n', 1, 'Public', NULL, 'marie-earle', 0, '2013-03-10 20:29:57', 1, '2014-02-09 18:03:39', 431),
