(300, '', '', '20888cea35902b675e74c09da9dcb2a1747470be', NULL, 'apridemt@msn.com', 0, NULL, NULL, NULL, NULL, 0, 1371366017, 1, 'Alycia', 'Patencio', 'Alycia Patencio', 'Patencio, Alycia', '821 S Tracy Ave', 'Bozeman', 'MT', '59715', '(406) 451 1721', '', 34, 107, NULL, NULL, NULL, 'I live in Montana and I am a founding member of the Big Sky Bat Dog team. (Bat Dog means bat eared dog) I love playing frisbee with my dogs and fellow disc doggers. I''ve traveled to a lot of competitions in a lot of different places and not done well. I have won some hardware a few times but mostly, I love meeting fellow like minded people who love their dogs and sharing this sport. One of my favorite places to play is Colorado because the CDD folks have always been generous with their time, experience and friendliness. AND the light air makes the frisbee go farther so that is a plus in my book. I don''t take too much seriously and I am in this sport for the fun and comradery.', NULL, 'None', NULL, 'alycia-patencio', 0, '2013-03-10 20:29:57', 1, '2014-02-09 18:04:15', 431),
