(333, '', '', '461df66b48aef29d65b9131b81731c569fdd3681', NULL, 'keva.heather@comcast.net', 0, NULL, NULL, NULL, NULL, 0, 1381283705, 1, 'Heather', 'White', 'Heather White', 'White, Heather', '4727 Shadowglen Dr', 'Colorado Springs', 'CO', '80918', '', '(719) 201-6331', 49, 547, '2013-03-30', '333_IMG_1312.JPG', NULL, 'Hi I''m Heather, I started in the disc dog sport in 2010 with my dog Marley. We took home the Rookie Award in 2010. This was Marley''s 2nd Rookie Award. In 2009 he and my husband Brian won. Finding Colorado Disc Dogs has completely changed my life, both mentally and physically. Joining this Club, of like minded people, has been a God send for me. In 2009 I went through a major life change due to a lengthy back surgery and recovery.  Being a part of an extraordinary, extended Family (CDD), has been the best thing that I could have ever asked for. In the fall of 2011 I was blessed with Keva, she had some issues with trust and was very shy about everything when we rescued her.  After working very hard with her and with the help of the CDD, she has turned into a wonderful goofy girl. She always makes me laugh, therefore her nickname "Ms. McGiggles". Last year (2012) was Keva''s and my year to start performing on the CDD Demo Team. Keva has brought a very special show stopper trick, in that she loves to pick up as many discs as possible, her current record is 12 which she achieved at Estes Highlands Festival. I also currently hold the Club''s executive position of Secretary. This is my first season as an officer. I hope I can do as good of a job as the people have before me and be able to bring more high flyin'' fun to the residents of Colorado. I am very much looking forward to the 2013 season. ', 1, 'Public', 0000, 'heather-white', 0, '2013-03-10 20:29:58', 1, '2014-02-09 18:04:30', 431),
(334, '', '', '3eed1bc06dc369ad82d8894bba90b666553234c6', NULL, 'bobo-n-koko@comcast.net', 0, NULL, NULL, NULL, NULL, 0, 1381632739, 1, 'Brian', 'White', 'Brian White', 'White, Brian', '4727 Shadowglen Dr', 'Colorado Springs', 'CO', '80918', '', '(719) 331-3528', 49, 453, '2013-03-30', '334_DSC_8699.JPG', NULL, 'MK Disc Herders\n\nBrian and Marley were the 2009 Rookie of the Year Team. They have finished in the top 10 for last two seasons', 1, 'Public', NULL, 'brian-white', 0, '2013-03-10 20:29:58', 1, '2014-02-09 18:04:30', 431),
(335, '', '', 'deea124fa34b0b932d6612b0ce36fc7b13fc8d00', NULL, 'pamelawyman66@gmail.com', 0, NULL, NULL, NULL, NULL, 0, 1379353641, 1, 'Pamela', 'Wyman', 'Pamela Wyman', 'Wyman, Pamela', '12729 Elm Street', 'Thornton', 'CO', '80241', '(303) 452-2324', '(720) 260-5115', 50, 564, '2013-03-15', '335_CDD_for_life_Man.JPG', NULL, 'Do you remember the day you fell in love, the birth of your children  those moments that will weave the fabric of change into your life forever? My induction into this amazing world of Frisbee dogs, and the C.D.D. happens to be one of those moments.  My Aussie Shadow, found a Frisbee in the park. It was the pure look of joy on his face, that kept me focused on finding a way to ensure he always had that look of joy.  A quick look at the website, a phone call and we were hooked. We have been playing now for 4 years. Yes, we enjoy the new friends we have, playing with my dogs is better then going to the gym, and the medals look good on the wall. But its that look of joy, that motives me to play. So, beware if a Frisbee brings your dog that look of joy, then I will be seeing you soon! ', 1, 'Public', NULL, 'pamela-wyman', 0, '2013-03-10 20:29:58', 1, '2014-02-09 18:04:31', 431),
(336, '', '', 'f479149eb3ae586bfa9fff72cc3a5bb88a40459f', NULL, 'bobwyman2324@msn.com', 0, NULL, NULL, NULL, NULL, 0, 1381633387, 1, 'Robert', 'Wyman', 'Robert Wyman', 'Wyman, Robert', '12729 Elm Street', 'Thornton', 'CO', '80241', '(303) 842-2322', '(720) 260-5112', 50, 471, '2013-03-15', '336_image1.jpg', NULL, 'Hi,  I am Bob and have been with CDD since 2009.  I have to thank my involvement with this fun sport to my dog Shadow who at 18 months of age picked up a Frisbee and brought it to my wife.  I played frisbee with people in my past but with DOGS?  I was hooked after the first throw and Shadow caught it and guess what brought it back and looked at me and said Do It Again!  You experience what enjoyment it is to play with your dog in the park watching the grace and skill of the dogs and the handlers.  Thank you for stopping by and taking the time to look us up.  Get out and play!!!!', 1, 'Public', NULL, 'robert-wyman', 0, '2013-03-10 20:29:58', 1, '2014-02-09 18:04:31', 431),
