(430, '', '', '', NULL, '', 0, NULL, NULL, NULL, NULL, 0, NULL, 1, 'Ryan', 'Douglas', 'Ryan Douglas', 'Douglas, Ryan', '', '', 'CO', '', '', '', NULL, 296, '0000-00-00', NULL, NULL, NULL, NULL, 'None', NULL, 'ryan-douglas', 0, '2013-03-10 20:29:58', 1, '2014-02-09 18:05:15', 431),
(431, '', 'rgreenphoto', 'b83681151e13ce10da91988ba19f921217f5dba8', NULL, 'russell.green@comcast.net', 0, NULL, NULL, NULL, NULL, 0, 1393176813, 1, 'Russ', 'Green', 'Russ Green', 'Green, Russ', '5589 S. Sherman Circle', 'Littleton', 'CO', '80121', '(303) 437-5865', '(303) 437-5865', NULL, 295, '2013-03-30', '431_handshake300.jpg', 'Russ has been playing since 2006 and been loving every minute of it. Check out his profile to see his high flying disc dogs.', 'It all started back in late 2004. I had just purchased my first house and I thought what better way to warm the new home than with a dog. Granted before I even moved in I began my search. One day, at work I was looking at the available pets on <a href="http://ddfl.org" target="_blank">Denver Dumb Friends League</a> and saw a photo that changed my world. That afternoon, I took off early from work and me Mariah. A timid aussie mix that needed a good home. I fell in love from moment one. It took Mariah a couple of days. Bless her heart, the counselor at DDFL was very determined to make sure Mariah went to a good home. I spent a couple of hours convincing her she''d be OK with me that we''d get involved in a sport. \n\nLuckily for all of us, I won the counselor over! Mariah came home with me and made me the luckiest person alive. \n\nA few short months later, Mariah and I participated in the DDFL Furry Scurry. We also happened to see the Colorado Disc Dogs in action. We literally ''scurried'' over to the CDD info booth. Soon after, we attended our first Spring Training event. \n\nThe rest is history.', 1, 'Public', NULL, 'russ-green', 0, '2013-03-10 20:29:58', 1, '2014-02-09 18:05:16', 431),
