(565, '', 'Suki', '33290027e9a20598e4e76084ad08936826e9f2d1', NULL, 'ginagiles@sitmeanssit.com', 0, NULL, NULL, NULL, NULL, 0, 1381367610, 1, 'Gina', 'Giles', 'Gina Giles', 'Giles, Gina', '1158 Cottonwood Ave', 'Fort Lupton', 'CO', '80621', '720-261-3801', NULL, NULL, 713, '0000-00-00', '565_suke_jeep.jpg', NULL, 'Suki is a pit bull that me and my husband rescued at the beginning of 2013.  We found out that she loved playing Frisbee the day before the spring training.  Suki was instantly hooked and after she started winning I became hooked and try to make every competition to have a good time with her.  It has truly built an even better relationship between us.', 1, 'Public', 2013, 'gina-giles', 0, '2013-06-08 20:10:40', 431, '2014-02-09 18:06:20', 431),
(566, '', 'wayne', '1b6c2da6eb96c6558e3994cd464805b6eb3147c8', NULL, 'waynegiles383@yahoo.com', 0, NULL, NULL, NULL, NULL, 0, 1381290595, 1, 'Wayne', 'Giles', 'Wayne Giles', 'Giles, Wayne', '1158 Cottonwood Ave', 'Fort Lupton', 'Co', '80621', '303-396-8404', NULL, NULL, 714, '0000-00-00', '566_suki_cdd_2.jpg', NULL, 'My wife and I rescued Suki, a 1 year old pit bull about 7 months ago for my wife. Building my relationship with Suki was very challenging as we believe she was abused by a male. I started to play Frisbee with her at CDD which helped our relationship greatly. It is a terrific feeling to have Suki enjoy spending time with me.', 0, 'Public', 2013, 'wayne-giles', 0, '2013-06-08 20:10:40', 431, '2014-02-09 18:06:20', 431),
